mapper.select:
select 

from F_FIDELIZADOS_ACCESO_TBL
where UID_INSTANCIA = #{uidInstancia,jdbcType=VARCHAR}
  and USUARIO = #{usuario,jdbcType=VARCHAR}

mapper.delete:
delete from F_FIDELIZADOS_ACCESO_TBL
where UID_INSTANCIA = #{uidInstancia,jdbcType=VARCHAR}
  and USUARIO = #{usuario,jdbcType=VARCHAR}
